$(document).ready(function(){
    var isFrontFeatureDiscovery = false;
    $('ul.tabs').tabs();
    $('select').material_select();
    $(".button-collapse").sideNav();
    $("#wallet-design").click(function(){
        
        if($('#paperwallet').is(':visible'))
        {
            if(Materialize) {
                var $toastContent = $('<span class=\'yellow-text\'>Биткойн хаяг үүсгэж байна түр хүлээн үү!</span>');
                Materialize.toast($toastContent, 4000)
            } else {
                alert("Биткойн хаяг үүсгэж байна түр хүлээн үү!");
            }

        } else {
            $("#navbar-logo").text("Цаасан хэтэвчний загвар");
            $("#wallet-design-area").removeClass("hide");
            $("#wallet-front-menu").removeClass("yellow darken-1");
            $("#wallet-back-menu").removeClass("yellow darken-1");
    
            $("#generate").addClass("hide");
            $("#wallet-front-area").addClass("hide");
            $("#wallet-back-area").addClass("hide");
            $("#wallet-design-menu").addClass("yellow darken-1");

            $("#fixed-next-btn").removeClass("hide");
        }
    });
    $("#wallet-front").click(function(){
        
        
        if($('#paperwallet').is(':visible'))
        {
            if(Materialize) {
                var $toastContent = $('<span class=\'yellow-text\'>Биткойн хаяг үүсгэж байна түр хүлээн үү!</span>');
                Materialize.toast($toastContent, 4000)
            } else {
                alert("Биткойн хаяг үүсгэж байна түр хүлээн үү!");
            }

        } else {
            $("#navbar-logo").text("Цаасан хэтэвчний нүүр");
            $("#wallet-front-area").removeClass("hide");
            $("#wallet-design-menu").removeClass("yellow darken-1");
            $("#wallet-back-menu").removeClass("yellow darken-1");

            $("#generate").addClass("hide");
            $("#wallet-design-area").addClass("hide");
            $("#wallet-back-area").addClass("hide");
            $("#wallet-front-menu").addClass("yellow darken-1");

            $("#fixed-next-btn").removeClass("hide");

            if(!isFrontFeatureDiscovery){
                $('#fixed-next-btn-front').tapTarget('open');
                isFrontFeatureDiscovery = true;
            }
            
        }
    });

    $("#wallet-back").click(function(){
        
        if($('#paperwallet').is(':visible'))
        {
            if(Materialize) {
                var $toastContent = $('<span class=\'yellow-text\'>Биткойн хаяг үүсгэж байна түр хүлээн үү!</span>');
                Materialize.toast($toastContent, 4000)
            } else {
                alert("Биткойн хаяг үүсгэж байна түр хүлээн үү!");
            }

        } else {
            $("#navbar-logo").text("Цаасан хэтэвчний ар");
            $("#wallet-back-area").removeClass("hide");
            $("#wallet-design-menu").removeClass("yellow darken-1");
            $("#wallet-front-menu").removeClass("yellow darken-1");

            $("#generate").addClass("hide");
            $("#wallet-front-area").addClass("hide");
            $("#wallet-design-area").addClass("hide");
            $("#wallet-back-menu").addClass("yellow darken-1");

            $("#fixed-next-btn").addClass("hide");
        }
    });

    $("#wallet-design-select").change(function(){
        var $selectValue = $("#wallet-design-select option:selected").val();
    });

    $("#fixed-next-btn").click(function(){
    
        if(!$("#wallet-design-area").hasClass('hide')) {
            $("#wallet-front").click();
        } else if(!$("#wallet-front-area").css('hide')) {
            $("#wallet-back").click();
        }
    });

    $("#papergenerateback").click(function(){
        $("#wallet-back-print").empty();
        $paperlimitback = $("#paperlimitback").val();
        for (k = 0; k < $paperlimitback; k++) { 
            $("#wallet-back-print").append("<div class='artwallet'> <img height='261' width='486' class='papersvgback' src='data:image/jpeg;base64,'/></div>");
        }
    });
});